import React from 'react'

function KeyboardLeft() {
    const a = (cl) => document.querySelector(cl)

    const catchNumber = (n) => {
        if(n.target.id === 'left') {
            a('.number1').value += n.target.innerHTML
        }
    }

  return (
    <div className='keyboard-left'>
        <div id="left" className='num1' onClick={catchNumber}>1</div>
        <div className='num2-left' onClick={catchNumber}>2</div>
        <div className='num3-left' onClick={catchNumber}>3</div>
        <div className='num4-left' onClick={catchNumber}>4</div>
        <div className='num5-left' onClick={catchNumber}>5</div>
        <div className='num6-left' onClick={catchNumber}>6</div>
        <div className='num7-left' onClick={catchNumber}>7</div>
        <div className='num8-left' onClick={catchNumber}>8</div>
        <div className='num9-left' onClick={catchNumber}>9</div>
        <div className='num0-left' onClick={catchNumber}>0</div>
    </div>
  )
}

export default KeyboardLeft
